import React from 'react';


function Showcase( {movies} )  {  
  const backdrops = movies.map(movie => {
  	return (  		
  		<img key={movie.id} src={`http://image.tmdb.org/t/p/w1280/${movie.backdrop}`} />		
  	) 

  })

  console.log(backdrops);
  return(
	  <div className="showcase">
	  	<div className="image-container">	  		
			{backdrops}
	  	</div>


	  </div>
  	)	  
}



export default Showcase;
